  input: TEXT,F3A,,"This report is being amended as a result of a letter dated October
    28, 2004 from the Federal Election Commision regarding the October Quarterly Report
    for the period from July 1, 2004 through September 30, 2004.  The Commission's
    letter requested that the report be amended to disclose employers and occupations
    of certain contributors to Gutierrez for Congress.  Gutierrez for Congress does
    exercise the 'best efforts' in attempting to provide the employer and occupation
    information as required by the law.  The Committee's original solicitation contains
    a clear and conspicuous request for the contributor information, and the solicitation
    also provides information that Federal law requires the reporting of this information
    per 11 CFR Section 104.7(b)(1).  If the information required is not provided with
    the initial solicitation, the Committee sends out a follow up request letter.  The
    follow up request letter asks for the necessary information.  The follow up request
    letter is sent out within seven days of receipt of the contribution.  The letter
    is sent out either by mail, e-mail, or fax.  Thereafter, telephone calls are made
    to attempt to secure the necessary information.  Once the information is received,
    the Committee amends the relevant report."
